import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Main from './components/MainComponent';
import './App.css';

function App() {
  return (
    <React.StrictMode>
    <BrowserRouter>
      <div>
        <Main />
      </div>
    </BrowserRouter>
    </React.StrictMode>
  );
}

export default App;
